import { useState, useRef, useEffect } from "react";
import PhotoStrip from "./PhotoStrip";
import "./App.css";
import LivePhoto from "./LivePhoto";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <LivePhoto />
                <br />
                <PhotoStrip />
            </header>
        </div>
    );
}

export default App;
